    return(
        <>
        <View>
            <FlatList
            data={info}
            renderItem={({item})=>{
                return <ImageContainer data={item}/>
                
            }}
            keyExtractor={item=>item.id}
            horizontal={true}
            />
        </View>
        </>
    )
}
export default Hotels
